import "./banner.css";
import { Button } from "react-bootstrap";
export default function Banner() {
  return (
    <div class="banner">
      <h1>Dental Clark</h1>
      <p>Tu sonrisa es nuestro compromiso</p>
      <div class="banner-buttons">
        <Button variant="primary">Primary</Button>
        <Button variant="primary">Primary</Button>
      </div>
    </div>
  );
}
